CREATE VIEW `family_branch_stages` AS with `branchedevos` as (select `pokemon`.`p_id` AS `p_id`,`pokemon`.`pokemon_name` AS `pokemon_name`,`pokemon`.`family_id` AS `family_id`,`pokemon`.`stage_id` AS `stage_id`,`pokemon`.`branch` AS `branch` from `pokemon` where (`pokemon`.`branch` = 2)), `branchingfams` as (select `branchedevos`.`family_id` AS `family_id`,`branchedevos`.`p_id` AS `p_id`,`branchedevos`.`pokemon_name` AS `pokemon_name`,`branchedevos`.`stage_id` AS `stage_id`,`branchedevos`.`branch` AS `branch`,`families`.`family_name` AS `family_name`,`families`.`candy_distance` AS `candy_distance` from (`branchedevos` join `families` on((`branchedevos`.`family_id` = `families`.`family_id`)))), `firstbranchstage` as (select `branchingfams`.`family_id` AS `family_id`,`branchingfams`.`p_id` AS `p_id`,`branchingfams`.`pokemon_name` AS `pokemon_name`,`branchingfams`.`stage_id` AS `stage_id`,`branchingfams`.`branch` AS `branch`,`branchingfams`.`family_name` AS `family_name`,`branchingfams`.`candy_distance` AS `candy_distance`,min(`branchingfams`.`stage_id`) OVER (PARTITION BY `branchingfams`.`family_id` )  AS `first_branch_stage` from `branchingfams`), `forkstageids` as (select distinct `firstbranchstage`.`family_id` AS `family_id`,`firstbranchstage`.`family_name` AS `family_name`,(`firstbranchstage`.`first_branch_stage` - 1) AS `fork_stage_id` from `firstbranchstage`), `result` as (select `f`.`family_id` AS `family_id`,`f`.`family_name` AS `family_name`,`f`.`fork_stage_id` AS `fork_stage_id`,`p`.`pokemon_name` AS `fork_stage_pokemon_name` from (`forkstageids` `f` left join `pokemon` `p` on(((`f`.`family_id` = `p`.`family_id`) and (`f`.`fork_stage_id` = `p`.`stage_id`))))) select `result`.`family_id` AS `family_id`,`result`.`family_name` AS `family_name`,`result`.`fork_stage_id` AS `fork_stage_id`,`result`.`fork_stage_pokemon_name` AS `fork_stage_pokemon_name` from `result`;


