DROP VIEW IF EXISTS `iv_combos_view`;
CREATE VIEW `iv_combos_view` AS with recursive `ivs` as (select 0 AS `iv` union all select (`ivs`.`iv` + 1) AS `iv` from `ivs` where (`ivs`.`iv` < 15)), `iv_combos` as (select row_number() OVER (ORDER BY `a`.`iv`,`d`.`iv`,`s`.`iv` )  AS `iv_id`,`a`.`iv` AS `atk_iv`,`d`.`iv` AS `def_iv`,`s`.`iv` AS `sta_iv`,concat_ws('-',convert(lpad(`a`.`iv`,2,0) using utf8mb4),convert(lpad(`d`.`iv`,2,0) using utf8mb4),convert(lpad(`s`.`iv`,2,0) using utf8mb4)) AS `iv_str` from ((`ivs` `a` join `ivs` `d`) join `ivs` `s`)) select `iv_combos`.`iv_id` AS `iv_id`,`iv_combos`.`atk_iv` AS `atk_iv`,`iv_combos`.`def_iv` AS `def_iv`,`iv_combos`.`sta_iv` AS `sta_iv`,`iv_combos`.`iv_str` AS `iv_str` from `iv_combos`;


