CREATE VIEW `total_dust_vs_cpm_gain_at_key_levels` AS select `vslevels`.`vsLevel` AS `vsLevel`,`fl`.`level` AS `level`,`fl`.`multiplier` AS `cpm`,round(((`fl`.`multiplier` / `l`.`multiplier`) * 100),2) AS `cpm_%_of_vsLevel`,`fl`.`total_dust` AS `total_dust`,round(((`fl`.`total_dust` / `l`.`total_dust`) * 100),2) AS `total_dust_%_of_vsLevel`,`fl`.`total_dust_shadow` AS `total_dust_shadow`,round(((`fl`.`total_dust_shadow` / `l`.`total_dust_shadow`) * 100),2) AS `total_dust_shadow_%_of_vsLevel`,`fl`.`total_dust_purified` AS `total_dust_purified`,round(((`fl`.`total_dust_purified` / `l`.`total_dust_purified`) * 100),2) AS `total_dust_purified_%_of_vsLevel` from (((values row(30),row(35),row(40),row(50)) `vslevels` (`vsLevel`) join (select `levels`.`level` AS `level`,`levels`.`multiplier` AS `multiplier`,`levels`.`dust_cost` AS `dust_cost`,`levels`.`candy_cost` AS `candy_cost`,`levels`.`xl_candy_cost` AS `xl_candy_cost`,`levels`.`total_dust` AS `total_dust`,`levels`.`total_candy` AS `total_candy`,`levels`.`total_xl_candy` AS `total_xl_candy`,`levels`.`total_dust_shadow` AS `total_dust_shadow`,`levels`.`total_candy_shadow` AS `total_candy_shadow`,`levels`.`total_xl_candy_shadow` AS `total_xl_candy_shadow`,`levels`.`total_dust_purified` AS `total_dust_purified`,`levels`.`total_candy_purified` AS `total_candy_purified`,`levels`.`total_xl_candy_purified` AS `total_xl_candy_purified` from `levels` where (`levels`.`level` between 30 and 50)) `fl`) join `levels` `l` on((`l`.`level` = `vslevels`.`vsLevel`))) order by `vslevels`.`vsLevel`,`fl`.`level`;

